Я истинный Водолей
Особые приметы - всем, ну абсолютно каждой падле нравится, как пресловутый червонец. По части по...еть составляет достойную конкуренцию Близнецам, общаться, даже в незнакомой компании рвется, как моряк дальнего плаванья в квартал красных фонарей. Выглядит всегда слегка с дуба рухнувшим, причем именно этим и завораживает. Лехкай флер еб.....сти придает Водолеям необъяснимое очарование, которое притягивает к ним глупеньких восторженных фоннатов. Даже если в жизни Водолея все идет через *опу, умудряется раздавать окружающим советы, которые, сука, работают. При всей видимой и осязаемой пушыстости и пи....тости потенциально - великий преступник. Всегда аферист, пусть только в мечтах. Не существует Водолея без уголовщины в темном прошлом, закон нарушает совершенно без угрызений совести и даже, не побоюсь этого слова, с наслаждением. При этом, сука, отлично понимает, в отличие от тех же Близнецов, что поступает некошерно, но клал на это. Внешне похожи на помесь Безумного Шляпника с Мэрилин Монро. 
                   ********
Растратчитца и истеричка Водолейка злобна, но отходчива, любит соблазнять и давать отпор, унижая человека. Она ненавидит когда незнакомые смотрят на неё как на секс-объект, хотя эротика присутствует для неё везде, даже в том, как ей подают пальто. Если Вы с ней сегодня впервые, едва ли дело закончится постелью, однако лучшего ДРУГА для мужика (практически любого) просто НЕ Бывает. Если уж совсем херово, она даст и даже не спросит, кто ты и откуда. Водолейка не возражает против мужского дела и (если нужда заставит) запросто может плотничать или шоферить, не любит кухарничать, а особенно готовить. Она с юности подбирает безупречного компаньона, но выходит замуж поздно, причем национальность, цвет кожи или вероисповедание её избранника будет удивлять даже саму Водолейку много лет. Из всего своего пёстрого (и недешёвого) гардероба активно предпочитает джинсы.
                ******
Хорошие девочки ждут принца на белом коне, плохие – миллионера на черном
"Мерседесе", умные считают обоих персонажей вымышленными;

Хорошие девочки спят в пижаме, плохие – голыми, умные – по ситуации;

Хорошие девочки верны мужу, плохие – любовнику, умные – обоим;

Хорошие девочки имеют работу, плохие – спонсора, умные – свой бизнес;

Хорошие девочки верят в чистую любовь, плохие – в частую, умные – в качественную;

Хорошие девочки одеваются аккуратно, плохие – вызывающе, умные – быстро;

Хорошие девочки лишаются девственности в первую брачную ночь, плохие – при первом удобном случае, умные – два-три раза;

Хорошие девочки верят мужчинам, плохие – не верят мужчинам, умные не верят никому
